  const [commission,setCommission] = useState({
    empID: userID,
    comTitle:"",
    comDeadline:"",
    comLocation:"",
    comType:"",
    comDescription:"",
    comPay:"",
    //comStatus:"",
    //catcherID:"",
    DatePosted:"",
    DateCompleted:"",
    Contactno: "",
   })

