const location = useLocation()
const userID = location.pathname.split("/")[2]

const handleChange = (e) => {
  if (e.target.name === 'comType') {
    setCommission((prev) => ({ ...prev, comType: e.target.value }));
  }
  else {
    // For other fields, use spread syntax as before
    setCommission((prev) => ({ ...prev, [e.target.name]: e.target.value }));
  }

};

  //get current date
        
    const getCurrentDate = () => {
    const currentDate = new Date();
    const year = currentDate.getFullYear();
    const month = String(currentDate.getMonth() + 1).padStart(2, '0'); // Months are 0-indexed, so add 1
    const day = String(currentDate.getDate()).padStart(2, '0');
  return `${year}-${month}-${day}`;
  };

    const handleClick = async (e) => {
      e.preventDefault();
      try {
        const currentDate = getCurrentDate();
        const updatedCommission = {
          ...commission,
          DatePosted: currentDate,
          empID: userID
        };
    
        await axios.post('http://localhost:8800/post-commission', updatedCommission);
        navigate(`/commissions/${userID}`);
      } catch (err) {
        console.log(err);
      }
    };
  


